//Simple Text and Botton Example
function App() {
  //formatting + Text written in Htl format:
  //'div' = division/section
  //'h1' = Headline 1
  //'p' = paragraph for text
  return (
    <div>
      <h1>My Account</h1>
      <div>
        <h2>Plan</h2>
        <div>
          <button>Upload</button>
        </div>
      </div>
    </div>
  );
}

export default App;
